<!DOCTYPE html>
<html lang=en>
<meta charset=utf-8>
<title>Swagger UI</title>
<style>.swagger-ui {
    color: #3b4151;
    font-family: sans-serif
}

.swagger-ui section {
    display: block
}

.swagger-ui a {
    background-color: transparent;
    -webkit-text-decoration-skip: objects
}

.swagger-ui img {
    border-style: none
}

.swagger-ui svg:not(:root) {
    overflow: hidden
}

.swagger-ui button, .swagger-ui input, .swagger-ui select {
    font-family: sans-serif;
    font-size: 100%;
    line-height: 1.15;
    margin: 0
}

.swagger-ui button, .swagger-ui input {
    overflow: visible
}

.swagger-ui button, .swagger-ui select {
    text-transform: none
}

.swagger-ui button {
    -webkit-appearance: button
}

.swagger-ui [type=button]::-moz-focus-inner, .swagger-ui [type=reset]::-moz-focus-inner, .swagger-ui [type=submit]::-moz-focus-inner, .swagger-ui button::-moz-focus-inner {
    border-style: none;
    padding: 0
}

.swagger-ui [type=button]:-moz-focusring, .swagger-ui [type=reset]:-moz-focusring, .swagger-ui [type=submit]:-moz-focusring, .swagger-ui button:-moz-focusring {
    outline: 1px dotted ButtonText
}

.swagger-ui ::-webkit-file-upload-button {
    -webkit-appearance: button;
    font: inherit
}

.swagger-ui a, .swagger-ui div, .swagger-ui form, .swagger-ui h2, .swagger-ui h3, .swagger-ui input[type=text], .swagger-ui p, .swagger-ui pre, .swagger-ui section {
    box-sizing: border-box
}

.swagger-ui img {
    max-width: 100%
}

.swagger-ui .link {
    text-decoration: none
}

.swagger-ui .link, .swagger-ui .link:link, .swagger-ui .link:visited {
    transition: color .15s ease-in
}

.swagger-ui .link:hover {
    transition: color .15s ease-in
}

.swagger-ui .link:active {
    transition: color .15s ease-in
}

.swagger-ui .link:focus {
    outline: 1px dotted currentColor;
    transition: color .15s ease-in
}

.swagger-ui .wrapper {
    box-sizing: border-box;
    margin: 0 auto;
    max-width: 1460px;
    padding: 0 20px;
    width: 100%
}

.swagger-ui .opblock-tag-section {
    display: flex;
    flex-direction: column
}

.swagger-ui .opblock-tag {
    align-items: center;
    border-bottom: 1px solid rgba(59, 65, 81, .3);
    cursor: pointer;
    display: flex;
    padding: 10px 20px 10px 10px;
    transition: all .2s
}

.swagger-ui .opblock-tag:hover {
    background: rgba(0, 0, 0, .02)
}

.swagger-ui .opblock-tag {
    color: #3b4151;
    font-family: sans-serif;
    font-size: 24px;
    margin: 0 0 5px
}

.swagger-ui .opblock-tag.no-desc span {
    flex: 1
}

.swagger-ui .opblock-tag svg {
    transition: all .4s
}

.swagger-ui .opblock-tag small {
    color: #3b4151;
    flex: 1;
    font-family: sans-serif;
    font-size: 14px;
    font-weight: 400;
    padding: 0 10px
}

.swagger-ui .opblock {
    border: 1px solid #000;
    border-radius: 4px;
    box-shadow: 0 0 3px rgba(0, 0, 0, .19);
    margin: 0 0 15px
}

.swagger-ui .opblock .opblock-summary-method {
    border-radius: 3px;
    color: #fff;
    font-family: sans-serif;
    font-size: 14px;
    font-weight: 700;
    min-width: 80px;
    padding: 6px 15px;
    text-align: center;
    text-shadow: 0 1px 0 rgba(0, 0, 0, .1)
}

.swagger-ui .opblock .opblock-summary-path {
    align-items: center;
    color: #3b4151;
    display: flex;
    font-family: monospace;
    font-size: 16px;
    font-weight: 600;
    padding: 0 10px;
    word-break: break-word
}

@media (max-width: 768px) {
    .swagger-ui .opblock .opblock-summary-path {
        font-size: 12px
    }
}

.swagger-ui .opblock .opblock-summary-path {
    flex-shrink: 0;
    max-width: calc(100% - 110px - 15rem)
}

.swagger-ui .opblock .opblock-summary-description {
    color: #3b4151;
    flex: 1 1 auto;
    font-family: sans-serif;
    font-size: 13px;
    word-break: break-word
}

.swagger-ui .opblock .opblock-summary {
    align-items: center;
    cursor: pointer;
    display: flex;
    padding: 5px
}

.swagger-ui .opblock.opblock-put {
    background: rgba(252, 161, 48, .1);
    border-color: #fca130
}

.swagger-ui .opblock.opblock-put .opblock-summary-method {
    background: #fca130
}

.swagger-ui .opblock.opblock-put .opblock-summary {
    border-color: #fca130
}

.swagger-ui .opblock.opblock-get {
    background: rgba(97, 175, 254, .1);
    border-color: #61affe
}

.swagger-ui .opblock.opblock-get .opblock-summary-method {
    background: #61affe
}

.swagger-ui .opblock.opblock-get .opblock-summary {
    border-color: #61affe
}

.swagger-ui .opblock.opblock-patch {
    background: rgba(80, 227, 194, .1);
    border-color: #50e3c2
}

.swagger-ui .opblock.opblock-patch .opblock-summary-method {
    background: #50e3c2
}

.swagger-ui .opblock.opblock-patch .opblock-summary {
    border-color: #50e3c2
}

.swagger-ui .scheme-container {
    background: #fff;
    box-shadow: 0 1px 2px 0 rgba(0, 0, 0, .15);
    margin: 0 0 20px;
    padding: 30px 0
}

.swagger-ui .scheme-container .schemes {
    align-items: flex-end;
    display: flex
}

@-webkit-keyframes rotation {
    to {
        transform: rotate(1turn)
    }
}

@keyframes rotation {
    to {
        transform: rotate(1turn)
    }
}

@-webkit-keyframes blinker {
    50% {
        opacity: 0
    }
}

@keyframes blinker {
    50% {
        opacity: 0
    }
}

.swagger-ui .no-margin {
    border: none;
    height: auto;
    margin: 0;
    padding: 0
}

.swagger-ui .float-right {
    float: right
}

.swagger-ui .svg-assets {
    height: 0;
    position: absolute;
    width: 0
}

.swagger-ui a.nostyle {
    display: inline
}

.swagger-ui a.nostyle, .swagger-ui a.nostyle:visited {
    color: inherit;
    cursor: pointer;
    text-decoration: inherit
}

.swagger-ui .btn {
    background: transparent;
    border: 2px solid grey;
    border-radius: 4px;
    box-shadow: 0 1px 2px rgba(0, 0, 0, .1);
    font-family: sans-serif;
    font-size: 14px;
    font-weight: 700;
    padding: 5px 23px;
    transition: all .3s
}

.swagger-ui .btn:hover {
    box-shadow: 0 0 5px rgba(0, 0, 0, .3)
}

.swagger-ui .btn.authorize {
    background-color: transparent;
    border-color: #49cc90;
    color: #49cc90;
    display: inline;
    line-height: 1
}

.swagger-ui .btn.authorize span {
    float: left;
    padding: 4px 20px 0 0
}

.swagger-ui .btn.authorize svg {
    fill: #49cc90
}

.swagger-ui .authorization__btn {
    background: none;
    border: none;
    padding: 0 10px
}

.swagger-ui .authorization__btn.unlocked {
    opacity: .4
}

.swagger-ui .opblock-summary-control {
    all: inherit;
    border-bottom: 0;
    cursor: pointer;
    flex: 1;
    padding: 0
}

.swagger-ui .model-box-control:focus, .swagger-ui .models-control:focus, .swagger-ui .opblock-summary-control:focus {
    outline: auto
}

.swagger-ui .expand-operation {
    background: none;
    border: none
}

.swagger-ui .expand-operation svg {
    height: 20px;
    width: 20px
}

.swagger-ui button {
    cursor: pointer
}

.swagger-ui label {
    font-weight: 700
}

@media (max-width: 768px) {
    .swagger-ui input[type=text] {
        max-width: 175px
    }
}

.swagger-ui input[type=text] {
    background: #fff;
    min-width: 100px;
    padding: 8px 10px
}

@-webkit-keyframes shake {
    10%, 90% {
        transform: translate3d(-1px, 0, 0)
    }
    20%, 80% {
        transform: translate3d(2px, 0, 0)
    }
    30%, 50%, 70% {
        transform: translate3d(-4px, 0, 0)
    }
    40%, 60% {
        transform: translate3d(4px, 0, 0)
    }
}

@keyframes shake {
    10%, 90% {
        transform: translate3d(-1px, 0, 0)
    }
    20%, 80% {
        transform: translate3d(2px, 0, 0)
    }
    30%, 50%, 70% {
        transform: translate3d(-4px, 0, 0)
    }
    40%, 60% {
        transform: translate3d(4px, 0, 0)
    }
}

.swagger-ui .servers > label {
    color: #3b4151;
    font-family: sans-serif;
    font-size: 12px;
    margin: -20px 15px 0 0
}

.swagger-ui .servers > label select {
    max-width: 100%;
    min-width: 130px
}

.swagger-ui .servers-title {
    font-size: 12px;
    font-weight: 700
}

.swagger-ui .topbar {
    background-color: #1b1b1b;
    padding: 10px 0
}

.swagger-ui .topbar .topbar-wrapper, .swagger-ui .topbar a {
    align-items: center;
    display: flex
}

.swagger-ui .topbar a {
    color: #fff;
    flex: 1;
    font-family: sans-serif;
    font-size: 1.5em;
    font-weight: 700;
    max-width: 300px;
    text-decoration: none
}

.swagger-ui .topbar .download-url-wrapper {
    display: flex;
    flex: 3;
    justify-content: flex-end
}

.swagger-ui .topbar .download-url-wrapper input[type=text] {
    border: 2px solid #62a03f;
    border-radius: 4px 0 0 4px;
    margin: 0;
    outline: none;
    width: 100%
}

.swagger-ui .topbar .download-url-wrapper .download-url-button {
    background: #62a03f;
    border: none;
    border-radius: 0 4px 4px 0;
    color: #fff;
    font-family: sans-serif;
    font-size: 16px;
    font-weight: 700;
    padding: 4px 30px
}

.swagger-ui .info {
    margin: 50px 0
}

.swagger-ui .info hgroup.main {
    margin: 0 0 20px
}

.swagger-ui .info hgroup.main a {
    font-size: 12px
}

.swagger-ui .info pre {
    font-size: 14px
}
